import React from "react";
import "./Notification.css";

const Account = () => {
  return (
    <div className="account-page">
      <h1 style={{ color: "white" }}>Account Page</h1>
      <h3 style={{ color: "white" }}>COMING SOON!</h3>
    </div>
  );
};
export default Account;
